import React, { useState, useEffect } from 'react';
import styled from 'styled-components/macro';
import { fetchAxios } from '../../Utils/Fetch';

const FormFields = styled.div`
  display: flex;
  flex-direction: column;

  input {
    margin-bottom: 10px;
  }
`;

export default function FormDetail() {
  const [formData, setFormData] = useState({
    postCode: '',
    suburb: '',
    state: '',
  });

  const onChange = (event) => {
    setFormData({
      ...formData,
      [event.target.name]: event.target.value,
    });
  };

  const onSubmit = (event) => {
    event.preventDefault();
    fetchAxios('https://digitalapi.auspost.com.au/postcode/search.json', {
      q: formData.postCode,
    }).then((res) => {
      console.log(res);
    });
  };

  useEffect(() => {
    console.log('use effect');

    fetch('https://digitalapi.auspost.com.au/postcode/search.json?q=2103', {
      headers: {
        'AUTH-KEY': '872608e3-4530-4c6a-a369-052accb03ca8',
        'Content-Type': 'application/x-www-form-urlencoded',
        'Access-Control-Allow-Origin': '*',
      },
      mode: 'no-cors',
      redirect: 'follow',
    }).then((res) => {
      console.log(res);
    });
  }, []);

  return (
    <form onSubmit={onSubmit}>
      <FormFields>
        <input
          placeholder="Post Code"
          type="text"
          name="postCode"
          onChange={onChange}
          value={formData.postCode}
        />
        <input
          placeholder="Suburb"
          type="text"
          name="suburb"
          onChange={onChange}
          value={formData.suburb}
        />
        <input
          placeholder="State"
          type="text"
          name="state"
          onChange={onChange}
          value={formData.state}
        />
      </FormFields>
      <button type="submit">Click Me</button>
    </form>
  );
}
